import { Avatar } from '@material-ui/core';
import React from 'react';
import './Story.scss'

export default function Story({ image , profileSrc , title }) {
    return (
        <div className = "story" style = {{backgroundImage : `url(${image})`}}>
            <Avatar className = "" src = {profileSrc}/>
            <h4>{title}</h4>
        </div>
    );
}
